import React from "react";
import { Link } from "react-router-dom";

const CreateButton = (caption, link, cssClass) => {
  return (
    <React.Fragment>
      <Link to={link} className={cssClass}>
        Create a {caption}
      </Link>
    </React.Fragment>
  );
};

